    private static List<Integer> convertToIntegerList1(List<String> stringList) {
        ArrayList<Integer> intList = new ArrayList<>();
        for (String s : stringList) {
            intList.add(Integer.valueOf(s));
        }
        return intList;
    }

    private static List<Integer> convertToIntegerList2(List<String> stringList) {

        ArrayList<Integer> intList = new ArrayList<>();
        stringList.stream().map(Integer::valueOf).forEach(intList::add);
        return intList;
    }

    private static List<Integer> convertToIntegerList3(List<String> stringList) {

        return stringList.stream().map(Integer::valueOf).collect(Collectors.toList());
    }

    private static List<Integer> convertToIntegerList4(List<String> stringList) {

        ArrayList<Integer> intList = new ArrayList<>();
        stringList.stream().mapToInt(Integer::valueOf).forEach(intList::add);
        return intList;
    }


